import React, { useEffect, useContext, useState } from 'react';
import Hero from './Eqipment/Hero';
import CablingEquipment from './Eqipment/CablingEquipment';
import TrustPilot from "../SuccessStory/Story/Trustpilot";
import queryString from "query-string";
import axios from 'axios'
import { GlobalContext } from "../Context/Context";

const Index = () => {
    const { catID, category, parent } = queryString.parse(window.location.search);
    const { getAllProductCategories, productCategory, setProductDetail } = useContext(GlobalContext);
    const [productData, setProductData] = useState([])
    useEffect(() => {
        getAllProductCategories(category, 1);

    }, [])



    return (
        <div>
            <Hero />
            <CablingEquipment
                getAllProductCategories={getAllProductCategories}
                setProductDetail={setProductDetail}
                productCategory={productCategory}
                catID={catID}
                category={category}
                parent={parent}
                productData={productData}
            />
            <TrustPilot />
        </div>
    )
}

export default Index;
